import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Switch, Route} from 'react-router-dom'

import Homepage from './components/Homepage';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      </header>
      <div>
        <Switch>
          <Route exact path="/">
            <Homepage/>
          </Route>
        </Switch>
      </div>
    </div>
  );
}

export default App;
